(1, '2015-06-10 14:09:24', 'tecno', 'CÃ³mo es el uso del 4G en la Argentina', 'Personal y Movistar hicieron un anÃ¡lisis del servicio a seis meses de estar disponible en varias provincias. Los equipos mÃ¡s utilizados para emplear la red de alta velocidad son de Apple, Motorola y Nokia. Videos, el contenido mÃ¡s consumido', 'Seis meses pasaron desde que dos de las operadoras pusieran en marcha su red 4G de telefonÃ­a, posibilitando una mejora en la velocidad de navegaciÃ³n y, de manera paulatina, una mayor eficiencia en llamadas y consumo de datos.\r\n\r\nMovistar y Personal elaboraron una radiografÃ­a sobre el uso del 4G en las provincias donde existe el servicio. La firma propiedad de TelefÃ³nica posee cobertura en mÃ¡s de 100 localidades de 12 provincias, lo cual comprende al 80% de la Ciudad de Buenos Aires gracias a mÃ¡s de 1.000 antenas de LTE. En los prÃ³ximos meses, ese nÃºmero treparÃ¡ hasta 1.850 radiobases.\r\nClaro cuenta con cobertura en algunas ciudades de Buenos Aires, Mar del Plata, CÃ³rdoba, Rosario y Mendoza, pero no informa con detalle sobre el servicio ya que espera tener ampliamente desarrollada su red antes de comunicarlo al pÃºblico.\r\n\r\nDe cualquier modo, mÃ¡s de 1 millÃ³n de personas estÃ¡n en condiciones de emplear las redes 4G. Ese nÃºmero es resultado de la sumatoria ofrecida por Personal y Movistar.', , 'image/jpeg');
