(4, '2015-06-10 15:26:31', 'politica', 'La flor metÃ¡lica volverÃ¡ a mover sus pÃ©talos es', 'La Floralis GenÃ©rica, ubicada a metros de la Facultad de Derecho, retomarÃ¡ su actividad despuÃ©s de seis aÃ±os. SerÃ¡ en el marco de un espectÃ¡culo visual y un recital de<b> Baglietto y Vitale</b>', '<div>Hoy los pÃ©talos de la Floralis GenÃ©rica volverÃ¡n a funcionar. Se trata de la estructura metÃ¡lica de 22 metros de altura y 24 toneladas de peso ubicada a metros de la Facultad de Derecho. La reinauguraciÃ³n contarÃ¡ con un recital en vivo del dÃºo <b>Baglietto-Vitale.</b></div><div><br></div><div>El evento, de carÃ¡cter gratuito, se realizarÃ¡ desde las 18 en la Plaza de Las Naciones. El espectÃ¡culo, denominado "Buenos Aires en Flor" tambiÃ©n promete una pantalla gigante de agua con efectos visuales.</div><div><br></div><div>Hace seis aÃ±os que la<b> <font color="#0099cc">Floralis </font></b>no abre ni cierra sus pÃ©talos debido a desperfectos tÃ©cnicos. "Constituye un orgullo recuperar este icono de Buenos Aires. Es un gran honor devolverle a la Ciudad un sofisticado monumento que combina la mecÃ¡nica, el arte y un mensaje por la naturaleza y por la vida", destacÃ³ el ministro de <b>Ambiente y Espacio PÃºblico porteÃ±o</b>, Edgardo CenzÃ³n.</div><div><br></div><div>Desde el aÃ±o pasado se retomaron los trabajos de reparaciÃ³n del mecanismo que permite abrir y cerrar los pÃ©talos. Se trata de una iniciativa del Gobierno de la Ciudad con el apoyo de la empresa OCA y el soporte tÃ©cnico de ingenieros de la UTN.</div><div><br></div><div>Entre los arreglos se incluye un sensor de viento y agua que permitirÃ¡ que los pÃ©talos se cierren en caso de temporales. AdemÃ¡s, se sumaron placas de aluminio y soldaduras que reforzarÃ¡n la resistencia durante las tormentas.</div>', , 'image/jpeg');
