(5, '2015-06-10 15:36:32', 'politica', 'Massistas debatieron su futuro hasta la madrugada:', 'El lÃ­der del <b>Frente Renovador</b> se reuniÃ³ con sus dirigentes para analizar quÃ© harÃ¡ con su candidatura. Dos intendentes faltaron y ya lo dan en el kirchnerismo.<br>', '<div>Unos cien dirigentes del Frente Renovador se reunieron hasta las 3 de la madrugada de este martes en Bella Vista, San Miguel, para decidir su futuro. Tras el nuevo rechazo que recibieron del PRO, la UCR y la CoaliciÃ³n CÃ­vica para ingresar a su alianza, las preguntas eran muchas: Â¿seguirÃ¡n adelante con la candidatura presidencial de Sergio Massa? Â¿O apostarÃ¡n a capitalizar su poderÃ­o en la provincia de Buenos Aires con una postulaciÃ³n a gobernador? Unos pocos incluso llegaron a sugerir la posibilidad de volver a presentarse como intendente de Tigre o no ser candidato.</div><div><br></div><div>A la salida del encuentro, Massa hablÃ³ con los pocos periodistas que quedaban en el lugar, pero se negÃ³ a dar precisiones sobre su futuro. "No me pidan que anticipe ninguna decisiÃ³n ni ninguna situaciÃ³n, serÃ­a injusto con el resto de sus colegas", se excusÃ³. Tampoco dio muchas precisiones sobre el debate que acababa de terminar, aunque reconociÃ³ que se discutieron "varias hipÃ³tesis y escenarios". "Me contaron mÃ¡s o menos cada uno cÃ³mo veÃ­an el proceso para los prÃ³ximos 90 o 120 dÃ­as y dieron su opiniÃ³n sobre quÃ© tenÃ­amos que hacer y cuÃ¡l creen que es el camino mÃ¡s inteligente para la Argentina", detallÃ³.</div><div><br></div><div>Uno de los pocos dirigentes que tambiÃ©n aceptÃ³ hacer declaraciones fue el intendente de JunÃ­n, Mario Meoni, habitual vocero de las posturas massistas ante la prensa. El dirigente radical asegurÃ³ que en la reuniÃ³n no se tomÃ³ ninguna decisiÃ³n ya que el precandidato presidencial querÃ­a escuchar la opiniÃ³n de sus intendentes, diputados nacionales, legisladores bonaerenses y asesores para luego reflexionar en soledad. "Fue anÃ¡lisis de coyuntura y de las posibilidades, sin decisiÃ³n final", asegurÃ³ a la agencia TÃ©lam.</div><div><br></div><div>Massa convocÃ³ a una conferencia de prensa para este miÃ©rcoles al mediodÃ­a. AllÃ­ anunciarÃ¡ su decisiÃ³n al filo del fin del plazo para la inscripciÃ³n de alianzas electorales, cuyo plazo mÃ¡ximo es esa misma medianoche. La movida recuerda a la jugada que el Frente Renovador hizo antes de las elecciones de 2013: jugar con la incÃ³gnita hasta Ãºltimo minuto para quedarse con el centro de la escena.</div>', , 'image/jpeg');
