(6, '2015-06-10 15:42:20', 'tecno', 'Facebook lanzÃ³ una aplicaciÃ³n para paÃ­ses emerg', 'Es menos sofisticada que la versiÃ³n actual y estÃ¡ pensada para funcionar en zonas donde hay conexiones deficientes. La red social presentÃ³ stickers por la Copa AmÃ©rica<br>', '<div>La aplicaciÃ³n, llamada Facebook Lite, estÃ¡ disponible en paÃ­ses en Asia y luego avanzarÃ¡ a regiones de AmÃ©rica Latina, Ãfrica y Europa, dijo Vijay Shankar, jefe de producto de Facebook Lite.</div><div><br></div><div>En muchos de esos paÃ­ses la gente aÃºn usa redes 2G, que son mucho mÃ¡s lentas y tienen menos poder que las redes de 4G en muchos paÃ­ses desarrollados. AdemÃ¡s, Facebook Lite estÃ¡ pensada para emplear menos datos, lo cual resulta en un menor impacto en el consumo.</div><div><br></div><div><b>"Queremos ofrecer a la gente una opciÃ³n para que, aun habiendo limitaciones, pueda tener la experiencia completa de Facebook"</b>, dijo Shankar.</div><div><br></div><div>La aplicaciÃ³n emplea menos de medio megabyte para limitar el uso de datos y las tarifas de quienes estÃ¡n en mercados emergentes.</div><div><br></div><div>Si bien aÃºn soporta el feed de noticias de Facebook, las actualizaciones de estatus, notificaciones y fotos, no funciona con los videos y servicios de localizaciÃ³n avanzados.</div><div><br></div><h4>Stickers</h4><div>El inicio de la Copa AmÃ©rica de Chile sirviÃ³ para que Facebook presentara una serie especial de stickers animados para que los hinchas apoyen a sus selecciones.</div><div><br></div><div>El paquete incluye dos animaciones para cada una de las 12 selecciones que participan en el torneo y puede ser descartado gratuitamente de la Sticker Store en Messenger o haciendo click acÃ¡.</div>', , 'image/jpeg');
