(7, '2015-06-10 15:43:56', 'politica', 'CÃ³mo fueron los Ãºltimos movimientos de Burzaco e', 'Cuando se supo que habÃ­a decidido entregarse, <b>Burzaco </b>fue perseguido por la prensa durante su caminata por el centro histÃ³rico de Bolzano, aunque se negÃ³ a realizar declaraciones.<br>', '<div>Fueron 13 dÃ­as de incertidumbre, de marchas y contramarchas, de charlas y evaluaciones que desembocaron en la decisiÃ³n de que lo mejor era entregarse voluntariamente. SÃ³lo asÃ­ se podrÃ­a alivianar el peso que significaba aparecer en la prensa internacional como un prÃ³fugo buscado por Interpol en todo el planeta. Justo Ã©l, Alejandro Burzaco, un hombre que entiende como pocos el funcionamiento de la televisiÃ³n, era noticia en todos los medios de comunicaciÃ³n por el escÃ¡ndalo de corrupciÃ³n que sacude los cimientos de la FIFA.</div><div><br></div><div>El 27 de mayo pasado, el entonces CEO de la empresa Torneos se salvÃ³ milagrosamente de caer en la redada del FBI, que irrumpiÃ³ en el lujoso Baur Au Lac (un hotel cinco estrellas de ZÃºrich) y detuvo a siete ejecutivos de la entidad madre del fÃºtbol mundial que hoy afrontan cargos gravÃ­simos por cohecho, fraude y lavado de dinero, entre otros delitos.</div><div><br></div><div>Burzaco estaba allÃ­, a punto de desayunar en el bar del hotel, cuando vio entrar a un grupo de agentes que iban vestidos de azul y llevaban la inconfundible pechera del FBI. Escudado en su anonimato (pese a su poder, siempre cultivÃ³ un perfil bajÃ­simo), logrÃ³ eludir los tentÃ¡culos de la mayor agencia de investigaciÃ³n del mundo: se quedÃ³ inmÃ³vil en la silla del restaurante Baur Au Lac y asistiÃ³ impasible al desfile de detenidos.</div><div><br></div><div>Luego de comer las croissants con las que acompaÃ±aba su cafÃ©, esperÃ³ con paciencia el final del procedimiento y, aprovechando que los agentes no lo reconocieron, levantÃ³ un brazo para pedir la cuenta, pagÃ³ y luego desapareciÃ³.</div><div><br></div><div>Nada se supo de Ã©l hasta la maÃ±ana del 9 de junio, cuando, acompaÃ±ado por dos abogados, se presentÃ³ voluntariamente en una dependencia policial de la ciudad de Bolzano (al norte de Italia) y quedÃ³ detenido, aunque con el beneficio de arresto domiciliario.</div>', , 'image/jpeg');
