(8, '2015-06-15 16:41:55', 'sociedad', 'En Tierra del Fuego hay mÃ¡s castores que habitant', '<span style="color: rgb(17, 17, 17); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: 22px;">Los primeros de la especie llegaron en 1946 desde CanadÃ¡ para fomentar la industria peletera. Hoy se transformaron en una plaga que afect', '<p style="box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-stretch: normal; line-height: 22px; vertical-align: baseline; color: rgb(17, 17, 17);">Fueron traÃ­dos de CanadÃ¡ en 1946&nbsp;<b style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;">para fomentar la industria peletera,</b>&nbsp;pero la falta de animales depredadores en Tierra del Fuego hizo que<b style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;">&nbsp;los castores tomaran dominio absoluto de la zona</b>con el paso de los aÃ±os. Su reproducciÃ³n y expansiÃ³n por la isla no solo&nbsp;<b style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;">preocupa a los agricultores y ganaderos</b>, sino tambiÃ©n a los habitantes de Bariloche que temen que los roedores lleguen a la zona. Actualmente, hay 150 mil castores sobre 134 mil habitantes en Tierra del Fuego que dominan los bosques y<b style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;">&nbsp;ponen en peligro la riqueza forestal y la ganaderÃ­a</b>.</p><p style="box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-stretch: normal; line-height: 22px; vertical-align: baseline; color: rgb(17, 17, 17);">Los castores adultos pesan entre 23 y 25 kilos y suelen tener entre tres y cuatro crÃ­as por aÃ±o. Cada 18 meses, la poblaciÃ³n se duplica, se expanden rÃ¡pidamente y<b style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;">&nbsp;pueden acabar con seis hectÃ¡reas de bosques nativos por aÃ±o.</b>&nbsp;DaÃ±an el ecosistema porque sus construcciones inundan las riberas y ensanchan arroyos y rÃ­os, lo que erosiona el suelo y altera la calidad del agua. En tanto, los Ã¡rboles anegados mueren por defecto de la inmersiÃ³n, mientras que un pocentaje menor porque son descortezados.</p><p style="box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-stretch: normal; line-height: 22px; vertical-align: baseline; color: rgb(17, 17, 17);">Si bien en 2011 se aprobÃ³ un&nbsp;<b style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;">convenio de erradicaciÃ³n entre Argentina y Chile</b>, aÃºn permanece trunco. Al parecer, desde la SecretarÃ­a de Ambiente de la NaciÃ³n aseguran que la asignaciÃ³n de fondos "es inminente". "El proyecto tiene asignado<b style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;">&nbsp;US$ 3,9 millones del Fondo del Medio Ambiente Mundial</b>, a travÃ©s de OrganizaciÃ³n de las Naciones Unidas para la AlimentaciÃ³n y Agricultura, y un aporte de US$ 18,2 millones de NaciÃ³n. En su Ãºltima visita a Roma, la presidenta Cristina FernÃ¡ndez firmÃ³ acuerdos que incluyen la asignaciÃ³n de fondos. Apenas estÃ©n disponibles implementaremos varias estrategias, entre ellas la de controlar al castor", seÃ±alaron al&nbsp;<i style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;">diario ClarÃ­n.</i></p><p style="box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-stretch: normal; line-height: 22px; vertical-align: baseline; color: rgb(17, 17, 17);">Christopher Anderson, biÃ³logo de Conicet, le dijo a ClarÃ­n:<b style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;">&nbsp;"Es esperable que la invasiÃ³n llegue a Bariloche.</b>&nbsp;EstÃ¡ comprobado en Tierra del Fuego que tambiÃ©n puede habitar ambientes sin Ã¡rboles, es decir, la estepa. AsÃ­ que no hay razÃ³n para no predecir que la invasiÃ³n llegue a Bariloche o mÃ¡s".</p><p style="box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-stretch: normal; line-height: 22px; vertical-align: baseline; color: rgb(17, 17, 17);">El castor â€“afirman los expertos- puede ser daÃ±ino al medio ambiente:&nbsp;<b style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;">"Cambian drÃ¡sticamente la dinÃ¡mica de los rÃ­os y arroyos,</b>&nbsp;convierten tramos en lagunas, tienen fuerte impacto sobre el bosque de riberas", enumera&nbsp;<b style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;">Claudio ChehÃ©bar, biÃ³logo a cargo de la DelegaciÃ³n Regional Patagonia</b>&nbsp;de la AdministraciÃ³n de Parques Nacionales.</p><p style="box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-stretch: normal; line-height: 22px; vertical-align: baseline; color: rgb(17, 17, 17);">Y argumentÃ³: "En CanadÃ¡, el castor tiene depredadores naturales; en el sur, no. En su tierra nativa, los Ã¡rboles cortados rebrotan, pero en la isla una lenga que es cortada, muere. En el norte, los Ã¡rboles suelen soportar la inundaciÃ³n que producen los embalses; en Tierra del Fuego, no". AdemÃ¡s, destruyen la flora, sus diques obstruyen caminos y afectan la agricultura y ganaderÃ­a.</p><p style="box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-stretch: normal; line-height: 22px; vertical-align: baseline; color: rgb(17, 17, 17);">Marta Lizarralde, directora del laboratorio del Centro Austral de Investigaciones CientÃ­ficas, insistiÃ³ en la necesidad de un proyecto "permanente y a largo plazo".&nbsp;<b style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;">"El castor es un ingeniero hidraÃºlico perfecto, pero destructivo",</b>&nbsp;lanzÃ³.</p><p style="box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-stretch: normal; line-height: 22px; vertical-align: baseline; color: rgb(17, 17, 17);">A raÃ­z de la gran cantidad de castores, los gastronÃ³micos y autoridades del gobierno de Tierra del Fuego comenzaron a considerar en 2005&nbsp;<b style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;">el consumo de carne de castor,</b>&nbsp;aunque debe tener un proceso especial. Nutricionistas explicaron en su momento que esa carne es comestible, pero debe cumplir ciertos requisitos sanitarios, aunque posee<b style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;">&nbsp;alto valor nutritivo y calidad gustativa.</b>&nbsp;Entre los platos principales con la carne de castor figuran el lomo, el asado y la paleta. TambiÃ©n se preparan empanadas, rellenos para pastas, castor confitado y patÃ©s.</p><p style="box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-stretch: normal; line-height: 22px; vertical-align: baseline; color: rgb(17, 17, 17);"></p><p style="box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-stretch: normal; line-height: 22px; vertical-align: baseline; color: rgb(17, 17, 17);">Algunos chefs consideran que&nbsp;<b style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;">la carne de castor "es un poco negra, fibrosa y grasosa",</b>mientras que otros cocineros creen que de acuerdo al preparado, puede seducir muchos paladares. "No es difÃ­cil de preparar, pero hay que tener paciencia. Tiene futuro: para mÃ­ es una buena opciÃ³n para agregar a la carta", informÃ³ en diario La NaciÃ³n RubÃ©n LeguizamÃ³n, del restaurante del hotel Los Naranjos, marinÃ³ la carne en jugos cÃ­tricos por 24 horas y luego lo confitÃ³ en grasa de cerdo por cuatro horas mÃ¡s para sacarle la fibrosidad. Finalmente lo deshilachÃ³ y lo salteÃ³ con oliva, ajo y un toque de cointreau.</p>', , 'image/jpeg');

